import {Component} from "react";
import AddUser from "./components/AddUser";
import Users from "./components/Users";


class App extends Component {

    constructor(props) {
        super(props);
        this.state ={
            users:[
                {
                    id:1,
                    name:"guveb Ayvaz",
                    email:"guven@gmail.com"
                },
                {
                    id:2,
                    name:"hilal Ayvaz",
                    email:"guven@gmail.com"
                },
                {
                    id:3,
                    name:"Duru Ayvaz",
                    email:"guven@gmail.com"
                }
            ]
        };
    }
    render() {
        return (
            <div className="container">
                <h4>User App</h4>
                <hr/>
                <AddUser/>
                <hr/>
                <Users users ={this.state.users}/>
            </div>
        );
    }

}

export default App;
